import React from "react";
import "./Card.css";

interface Props {
  link: string;
}
const CardItem: React.FC<Props> = ({ link }) => {
  return (
    <div className="card-container">
      <div className="card-image">
        <img src={link} alt="" />
      </div>
      <div className="card-detail">Hello</div>
    </div>
  );
};

export default CardItem;
